import React from 'react'
import './domain.css'

const Healthcare = () => {
  const [formData, setFormData] = useState({
    question1: [],
    r1: '',
    r2: '',
    r3: '',
    r4: '',
    r5: '',
    question7: [],
    r6: '',
    r7: '',
    r8: '',
  });

  const handleCheckboxChange = (e) => {
    const { name, value, checked } = e.target;
    if (checked) {
      setFormData((prevData) => ({
        ...prevData,
        [name]: [...prevData[name], value],
      }));
    } else {
      setFormData((prevData) => ({
        ...prevData,
        [name]: prevData[name].filter((item) => item !== value),
      }));
    }
  };

  const handleRadioChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const submitForm = async () => {
    try {
      const response = await fetch('/api/answers', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
      if (response.status === 201) {
        window.location.href = '/answers';
      } else {
        console.error('Error submitting form');
      }
    } catch (error) {
      console.error('Error submitting form', error);
    }
  };

  return (
    <div className="fm">
        <form>
          <center><h1 className="title">Healthcare</h1></center>
            <div className="qns">
              <center><h1>Fill the following</h1></center>
                <label><b>1. What tasks or activities do you want to accomplish using cloud services?</b></label><br/>
                <input type="checkbox" name="qn1" value="ehr" onChange={handleCheckboxChange} /> Electronic health record management     <br />
                <input type="checkbox" name="qn1" value="tm" onChange={handleCheckboxChange}/> Telemedicine and video conferencing <br />
                <input type="checkbox" name="qn1" value="dsb" onChange={handleCheckboxChange}/> Data storage and backup <br />
                <input type="checkbox" name="qn1" value="hma" onChange={handleCheckboxChange}/> Healthcare mobile apps <br />
                <input type="checkbox" name="qn1" value="mi" onChange={handleCheckboxChange}/> Medical Imaging <br />
                <input type="checkbox" name="qn1" value="hw" onChange={handleCheckboxChange}/> Hosting Website <br />
                <label><b>2. Are you looking to enhance the efficiency of appointment scheduling and management?</b></label><br/>
                <input type="radio" name="r1" value="r1" onChange={handleRadioChange} />Yes  <input type="radio" name="r1" value="r1" onChange={handleRadioChange} />No <br />
                <label><b>3. Would you like to improve patient engagement and communication?</b></label><br/>
                <input type="radio" name="r2" value="r2" onChange={handleRadioChange} />Yes  <input type="radio" name="r2" value="r2" onChange={handleRadioChange} />No <br />
                <label><b>4. Are you interested in enhancing healthcare inventory and supply chain management?</b></label><br/>
                <input type="radio" name="r3" value="r3" onChange={handleRadioChange} />Yes  <input type="radio" name="r3" value="r3" onChange={handleRadioChange} />No <br />
                <label><b>5. Are you interested in improving healthcare analytics and reporting?  </b></label><br/>
                <input type="radio" name="r4" value="r4" onChange={handleRadioChange} />Yes  <input type="radio" name="r4" value="r4" onChange={handleRadioChange} />No <br />
                <label><b>6. Would you like to implement a healthcare chatbot for patient inquiries and support?</b></label><br/>
                <input type="radio" name="r5" value="r5" onChange={handleRadioChange} />Yes  <input type="radio" name="r5" value="r5" onChange={handleRadioChange} />No <br />
                <label><b>7. What is the expected geographical distribution of your users?</b></label><br/>
                <input type="checkbox" name="qn2" value="qn2" onChange={handleCheckboxChange} /> Local / Regional <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleCheckboxChange} /> National <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleCheckboxChange} /> Global <br />
                <label><b>8. Do you have any existing software?</b></label><br/>
                <input type="radio" name="r6" value="r6" onChange={handleRadioChange} />Yes  <input type="radio" name="r6" value="r6" onChange={handleRadioChange} />No <br />
                <label><b>9. Would you like to implement patient engagement portals for feedback, reviews, and interaction?  </b></label><br/>
                <input type="radio" name="r7" value="r7" onChange={handleRadioChange} />Yes  <input type="radio" name="r7" value="r7" onChange={handleRadioChange} />No <br />
                <label><b>10. Do you need a cloud service for remote patient monitoring, early warning systems, and alerts?   </b></label><br/>
                <input type="radio" name="r8" value="r8" onChange={handleRadioChange} />Yes  <input type="radio" name="r8" value="r8" onChange={handleRadioChange} />No <br />
                <center><button onClick={submitForm} className="btn1">Submit</button></center>
            </div>
        </form>
    </div>
  )
}

export default Healthcare;
